import React, { Component } from 'react';
import './Temp.css'

class WarmTemp extends Component {
    state = {
        warmTemp: null,
        loading: false,
        data: [],
    }

    componentDidMount() {
        this.setState({loading: true})
    }


    render () {
        const isBackgroundNormal = false;
        return (
            <div className={isBackgroundNormal ? null : 'background-hot'}>
                <body>
                <div className="loading-data">
                    {this.state.loading 
                    ? <p>loading recommendations for outdoor spots...</p>
                    : <div>
                    </div> }
                </div>
                </body>
            </div>
        )
    }

}

export default WarmTemp;
